// Asynchronous Loop //////////////////////////////////////////////////////////////////////////////////////////////////////////
function asyncLoop(iterations, func, callback) {
    var done = false;
    var loop = {
        next: function() {
            if (done) {
                return;
            }
            if (index < iterations) {
                index++;
                func(loop);
            } else {
                done = true;
                callback();
            }
        },
        iteration: function() {
            return index - 1;
        },
        breakme: function() {
            done = true;
            callback();
        }
    };
    loop.next();
    return loop;
}

